import React from 'react';

const UserForm = () => {
	return (
		<div>
			<label>
				<span>Username</span>
				<input type="text"></input>
			</label>
			<label>
				<span>Age(years)</span>
				<input type="text"></input>
			</label>
			<button type="submit">Add user</button>
		</div>
	);
}

export default UserForm;
